import { render } from "react-dom";

const Footer = () => {
  return (
    <>
      <footer>
        <div className="container">
          <div className="row pt-5">
            <div className="col-md-3">
              <h3>Minejobs</h3>
              <p>Lorem10</p>
            </div>
          </div>
        </div>
      </footer>
    </>
  );
};

export default Footer;
